import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Header.css";

const Header = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <header className="modern-header">
      <div className="header-inner">

        {/* ðŸ”¹ Logo image (links to Home page) */}
        <Link to="/" className="logo-link">
          <img
            src="/assets/whatnew.jpg"   // ðŸ–¼ï¸ Replace with your logo file path
            alt="WhatNew Logo"
            className="header-logo"
          />
        </Link>

        {/* ðŸ”¹ Mobile Menu Toggle */}
        <button
          className={`menu-toggle ${menuOpen ? "open" : ""}`}
          onClick={() => setMenuOpen(!menuOpen)}
          aria-label="Toggle menu"
        >
          <span></span>
          <span></span>
          <span></span>
        </button>

        {/* ðŸ”¹ Navigation Menu */}
        <nav className={`nav ${menuOpen ? "active" : ""}`}>
          <ul className="nav-list">
            <li>
              {/* ðŸ”¹ Become a Seller button */}
              <Link to="/Becomeseller" className="seller-btn">
                Become a Seller
              </Link>
            </li>
            {/* Removed Blog, Careers, About Us, FAQ, Affiliates */}
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
